def _try_convert_to_date(self, data):
        if not len(data):
            return data, False

        new_data = data
        if new_data.dtype == "object":
            try:
                new_data = data.astype("int64")
            except (TypeError, ValueError, OverflowError):
                pass

        if isinstance(new_data, pd.Series) and new_data.dtype == "bool":
            try:
                new_data = new_data.astype('int64', copy=False)
            except (TypeError, ValueError, OverflowError):
                pass

        if isinstance(new_data, pd.Series) and new_data.dtype == "int64":
            nan_value = pd.Interval(float('-inf'), self.min_stamp, closed='right')
            new_data = new_data.where(new_data.between(0, self.min_stamp) | new_data.isna(), nan_value)
            if new_data.isnull().any():
                return data, False

        try:
            new_data = to_datetime(new_data, errors="raise", unit=self.date_unit)
            return new_data, True
        except (ValueError, OverflowError, TypeError):
            return data, False
